  \"2016-03-17T20:51:48.321342\",\n\t\"name\": \"economic-development-projects-closed\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset includes information on economic
  development projects were awarded incentives through Iowa Economic Development Authority
  programs as early as FY 2003, and are considered u201ccompletedu201d by IEDAu2019s
  compliance team at the end of the fiscal year (annual report cut-off date).  Each
  project has been evaluated to determine if the it met all the terms of the contract.
  If all contractual terms are met, projects are categorized as \"successful\" and
  are under no additional obligation to report information to IEDA regarding the project.
  \ If a project was unable to meet all terms required in the contract, the IEDA compliance
  team determined the award u201crecaptureu201d u2013 consisting of paying back all
  or a portion of the direct assistance provided by the state or returning (or not
  claiming) some or all tax credits that had been awarded. These projects would be
  categorized as either u201cfull recaptureu201d or u201cpartial recaptureu201d of
  the award.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
